import HomePage from './pages/homepage/homepage.component.jsx';

import './App.css';
import Data from './pages/homepage/info.json'

function App() {
  return (
    <div className="App">
        <HomePage/>

        <div>
          {Data.map(products => {
            return(
              <div>
                <h4> {products.productName}</h4>
              </div>
            )
          })}
        </div>

    </div>
  );
}

export default App;
